# X-type stabilizers (single qubit)
x_single = []
for i, s in enumerate(stabilizers):
    # Count X and Z
    x_count = s.count('X')
    z_count = s.count('Z')
    if x_count > 0 and z_count == 0:
        x_single.append((i, s))
        
print(f"Found {len(x_single)} X-type stabilizers in first block")
print(f"First 5: {[i for i, _ in x_single[:5]]}")

# Find positions for first X-type
s0 = stabilizers[0]
x_positions_0 = [i for i, c in enumerate(s0) if c == 'X']
print(f"Stabilizer 0 X positions: {x_positions_0}")

# Analyze the pattern
for i in range(min(10, len(x_single))):
    idx, s = x_single[i]
    x_pos = [j for j, c in enumerate(s) if c == 'X']
    print(f"Stab {idx}: X at {x_pos}")
